(7104, 297, 25, 'android.permission.READ_LOGS, 允许程序读取底层系统日志文件</br>android.permission.ACCESS_COARSE_LOCATION, 允许一个程序访问CellID或WiFi热点来获取粗略的位置</br>android.permission.BLUETOOTH, 允许程序连接到已配对的蓝牙设备</br>android.permission.ACCESS_WIFI_STATE, 允许程序访问Wi-Fi网络状态信息</br>android.permission.INTERNET, 允许程序打开网络套接字</br>android.permission.CHANGE_CONFIGURATION, 允许一个程序修改当前设置，如本地化</br>ANDROID.PERMISSION.WRITE_EXTERNAL_STORAGE, 允许程序写入外部存储，如SD卡上写文件</br>android.permission.ACCESS_FINE_LOCATION, 允许一个程序访问精确位置(如GPS)</br>android.permission.ACCESS_NETWORK_STATE, 允许程序访问有关GSM网络信息</br>android.permission.GET_TASKS, 允许程序获取当前或最近运行的应用</br>ANDROID.PERMISSION.INTERNET, 允许程序打开网络套接字</br>android.permission.WRITE_EXTERNAL_STORAGE, 允许程序写入外部存储，如SD卡上写文件</br>android.permission.RECEIVE_SMS, 允许程序监控一个将收到短信息，记录或处理</br>android.permission.MANAGE_ACCOUNTS, Allows an application to perform operations like adding and removing accounts and deleting their password.</br>android.permission.READ_EXTERNAL_STORAGE, 允许程序读取外部存储，如SD卡读取文件</br>android.permission.RECEIVE_BOOT_COMPLETED, 允许一个程序开机自动运行</br>android.permission.BROADCAST_STICKY, 允许一个程序收到广播后快速收到下一个广播</br>android.permission.CALL_PHONE, 允许程序从非系统拨号器里输入电话号码</br>android.permission.FLASHLIGHT, 允许访问闪光灯</br>android.permission.READ_PHONE_STATE, 读取电话状态</br>android.permission.MODIFY_AUDIO_SETTINGS, 允许程序修改全局音频设置</br>android.permission.WRITE_CONTACTS, 允许程序写入但不读取用户联系人数据</br>android.permission.VIBRATE, 允许访问振动设备</br>android.permission.SYSTEM_ALERT_WINDOW, 显示系统窗口</br>android.permission.ACCESS_LOCATION_EXTRA_COMMANDS, 允许应用程序访问额外的位置提供命令</br>android.permission.CAMERA, 请求访问使用照相设备</br>android.permission.WAKE_LOCK, 允许程序在手机屏幕关闭后后台进程仍然运行</br>android.permission.CHANGE_WIFI_STATE, 允许程序改变Wi-Fi连接状态</br>android.permission.RECORD_AUDIO, 允许程序录制音频</br>android.permission.READ_CONTACTS, 允许程序读取用户联系人数据</br>android.permission.MOUNT_UNMOUNT_FILESYSTEMS, 允许挂载和反挂载文件系统可移动存储</br>android.permission.RESTART_PACKAGES, 允许程序重新启动其他程序</br>android.permission.GET_ACCOUNTS, 访问GMail账户列表</br>', 1),
